import React from 'react';
import { useState,useEffect } from 'react';
const Base = () => {
    const [data,setData] = useState([])
    const getData = async() => {
        const res = await fetch("https://63610b45af66cc87dc21409b.mockapi.io/property_data")
        const actualData = await res.json();
        setData(actualData);
        // console.log('data',data)
    }

    const arry = Object.keys(data)

    useEffect(()=>{
    getData()
    },[]) 

    return (
        <>

        <h1>Hello</h1>
        <table>
            <thead>
                <tr>
                    <th>Sr. no</th>
                <th>Name of Property</th>
                <th>Adress of Property</th>
                </tr>
            </thead>
            <tbody>
        {arry.map((value)=>{
            console.log('final map data',data[value].name)
            return (
                <>
                <tr>
                    <td>{data[value].id}</td>
                    <td>{data[value].name}</td>
                    <td>{data[value].address}</td>
                </tr>
                </>
                )
            })}
        </tbody>
            </table>
        </>
    )
}


export default Base;
